import './App.css';
import ModalPersona from './ModalPersona.js'
import * as React from 'react';
import Button from '@mui/material/Button';

function App() {
  const handlePress = () => {
    setButtonPressed(true);
  };

  const handleNotPress = () => {
    setButtonPressed(false);
  }

  const [buttonPressed, setButtonPressed] = React.useState(false);
  const props = {
    'a': buttonPressed,
    'b': setButtonPressed,
  };

  return (
    <div>
      <div className='buttonModal'>
        <Button onClick={handlePress} variant="outlined" >Asignar Persona</Button>
      </div>
      {buttonPressed && 
        <ModalPersona props={props}></ModalPersona>
      }
    </div>
  );
}

export default App;
